import moment from "moment";

const Div = ({ padding, dataResponse, num }) => {
  const data = [];
  const round = (num) => {
    return Math.round(num * 100) / 100;
  };
  data.push({
    weather: dataResponse.obj[num]?.weather,
    icon: dataResponse.obj[num]?.icon,
    temp: round(dataResponse.obj[num]?.temp - 273.15),
    feels_like: round(dataResponse.obj[num]?.feels_like - 273.15),
    pressure: dataResponse.obj[num]?.pressure,
    temp_min: round(dataResponse.obj[num]?.temp_min - 273.15),
    temp_max: round(dataResponse.obj[num]?.temp_max - 273.15),
    humidity: dataResponse.obj[num]?.humidity,
    visibility: dataResponse.obj[num]?.visibility,
    windSpeed: dataResponse.obj[num]?.windSpeed,
    sunrise: moment(dataResponse.obj[num]?.sunrise * 1e3)
      .format("hh:mm a")
      .toString(),
    sunset: moment(dataResponse.obj[num]?.sunset * 1e3)
      .format("hh:mm a")
      .toString(),
  });

  console.log(data)
  return (
    <div>
      <div>Tiempo: {data.weather}</div>
      {data.icon ? (
        <div>
          <img src={`http://openweathermap.org/img/wn/${data.icon}@2x.png`} />
        </div>
      ) : null}
      <div style={{ padding: padding }}>Temperatura: {data.temp}</div>
      <div style={{ padding: padding }}>
        Sensación Térmica: {data.feels_like}
      </div>
      <div style={{ padding: padding }}>
        Temperatura Mínima: {data.temp_min}
      </div>
      <div style={{ padding: padding }}>
        Temperatura Máxima: {data.temp_max}
      </div>
      <div style={{ padding: padding }}>Presión: {data.pressure}</div>
      <div style={{ padding: padding }}>Humedad: {data.humidity}</div>
      <div style={{ padding: padding }}>Visibilidad: {data.visibility}</div>
      <div style={{ padding: padding }}>
        Velocidad de viento: {data.windSpeed}
      </div>
      <div style={{ padding: padding }}>Amanecer: {data.sunrise}</div>
      <div style={{ padding: padding }}>Atardecer: {data.sunset}</div>
    </div>
  );
};

export default Div;
